function List(props) {
  return (
    <Fragment>
      <h1>Lista de Pokemon</h1>
      <Grid container spacing={24}></Grid>
      {props.pokedata.map((pokemon, index) => {
        return <PokeCard name={pokemon.name}></PokeCard>;
      })}
    </Fragment>
  );
}

export default List;
